import http from './http';

export default {
  common: {
    login(params) {
      return http.post('/common/login', { ...params });
    },
    error_msg(params) {
      return http.get('/common/error', { ...params });
    },
    captcha() {
      return http.get('/common/captcha')
    },
    peerid() {
      return http.get('/common/peerid', {
        clienttype: 'admin'
      })
    },
  }
}
